import React from "react";
import Navbar from "../Components/Navbar";

const Home = () => {
    return <div className="relative">
        <Navbar className="fixed top-0 left-0 right-0"></Navbar>
        <div className="">
            <img className="w-fullscreen" src={require('../assets/images/RajGad.jpg')} alt="" />
        </div>
    </div>
}

export default Home;
